import React from "react";

const dataAsistenciaGrados = [
  { grado: 8, porcentaje: 68 },
  { grado: 9, porcentaje: 72 },
  { grado: 10, porcentaje: 75 },
  { grado: 11, porcentaje: 69 },
];

const totalEstudiantes = 85;
const porcentajeAsistencia = 71;
const porcentajeUniforme = 79;

function CircleProgress({ percentage, label, color }) {
  // Cálculo para SVG circle stroke
  const radius = 60;
  const circumference = 2 * Math.PI * radius;
  const offset = circumference - (percentage / 100) * circumference;

  return (
    <div style={{ textAlign: "center", margin: 20 }}>
      <svg width={140} height={140}>
        <circle
          cx="70"
          cy="70"
          r={radius}
          stroke="#e6f2ff"
          strokeWidth="15"
          fill="none"
        />
        <circle
          cx="70"
          cy="70"
          r={radius}
          stroke={color}
          strokeWidth="15"
          fill="none"
          strokeDasharray={circumference}
          strokeDashoffset={offset}
          strokeLinecap="round"
          transform="rotate(-90 70 70)"
        />
        <text
          x="70"
          y="75"
          textAnchor="middle"
          fontSize="28"
          fontWeight="bold"
          fill={color}
        >
          {percentage}%
        </text>
      </svg>
      <p style={{ marginTop: 10, fontWeight: "600", color: "#003366" }}>{label}</p>
    </div>
  );
}

export default function Reportes() {
  return (
    <div style={{ padding: 30, fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif", backgroundColor: "#f0f8ff", minHeight: "100vh" }}>
      <h1 style={{ color: "#003366", marginBottom: 20 }}>Informes y Analíticas</h1>
      <p style={{ maxWidth: 600, color: "#333", marginBottom: 40 }}>
        Analiza los datos de asistencia y cumplimiento del uniforme en tiempo real.
      </p>

      <div style={{ display: "flex", gap: 40, flexWrap: "wrap", justifyContent: "center" }}>
        <CircleProgress percentage={porcentajeAsistencia} label="Asistencia General" color="#3498db" />
        <CircleProgress percentage={porcentajeUniforme} label="Cumplimiento de Uniforme" color="#27ae60" />
        <div style={{
          textAlign: "center",
          backgroundColor: "#B0E0E6",
          borderRadius: 12,
          padding: 20,
          boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
          minWidth: 140,
          fontWeight: "700",
          fontSize: "1.5rem",
          color: "#003366",
          userSelect: "none",
          alignSelf: "center"
        }}>
          +{totalEstudiantes}
          <p style={{ fontWeight: "normal", fontSize: "1rem", marginTop: 6 }}>Total de Estudiantes</p>
        </div>
      </div>

      <section style={{ marginTop: 50, maxWidth: 800 }}>
        <h2 style={{ color: "#003366", marginBottom: 20 }}>Tasa de Asistencia por Grado</h2>
        {dataAsistenciaGrados.map(({ grado, porcentaje }) => (
          <div key={grado} style={{ marginBottom: 20 }}>
            <div style={{ display: "flex", justifyContent: "space-between", marginBottom: 6 }}>
              <span style={{ fontWeight: "600", color: "#003366" }}>Grado {grado}</span>
              <span style={{ fontWeight: "600", color: "#3498db" }}>{porcentaje}%</span>
            </div>
            <div style={{ backgroundColor: "#d6eaf8", borderRadius: 8, height: 20, width: "100%" }}>
              <div
                style={{
                  width: `${porcentaje}%`,
                  height: "100%",
                  backgroundColor: "#3498db",
                  borderRadius: 8,
                  transition: "width 0.5s ease"
                }}
              />
            </div>
          </div>
        ))}
      </section>

      <section style={{ marginTop: 50, maxWidth: 800 }}>
        <h2 style={{ color: "#003366", marginBottom: 20 }}>Visión General del Cumplimiento del Uniforme</h2>
        <div style={{ display: "flex", gap: 20, flexWrap: "wrap" }}>
          <UniformeBar label="Conforme" porcentaje={79} color="#27ae60" />
          <UniformeBar label="No Conforme" porcentaje={21} color="#e74c3c" />
        </div>
      </section>
    </div>
  );
}

function UniformeBar({ label, porcentaje, color }) {
  return (
    <div style={{ flex: "1 1 250px" }}>
      <p style={{ fontWeight: "600", color: "#003366", marginBottom: 8 }}>{label}</p>
      <div style={{ backgroundColor: "#d6eaf8", borderRadius: 8, height: 25 }}>
        <div
          style={{
            width: `${porcentaje}%`,
            height: "100%",
            backgroundColor: color,
            borderRadius: 8,
            transition: "width 0.5s ease",
          }}
        />
      </div>
      <p style={{ fontWeight: "700", color: color, marginTop: 8, textAlign: "right" }}>{porcentaje}%</p>
    </div>
  );
}
